webpackJsonp([67],{358:function(e,t){e.exports={data:{config:{siteMetadata:{title:"Bricolage",author:"Kyle Mathews"}},markdown:{id:"/Users/kylemathews/programs/blog/pages/2007-04-19---seo-search-engine-optimization-basics/index.md",bodyHTML:'<p>A website\'s goal is to convert as many visitors as possible</p>\n<p>The number of conversions depend on two factors:</p>\n<ol>\n<li>number of visitors</li>\n<li>% of total visitors the website converts</li>\n</ol>\n<p>SEO practitioners optimize web pages so the pages show up high in search engine rankings. This drives more traffic to the page which increases the number of conversions. How high a web page shows up in a search engine ranking page (SERP) is <a href="http://www.seomoz.org/blog/if-your-page-ranks-well-youd-better-be-messing-with-it" title="SEO ranking factors">based on three factors:</a></p>\n<ol>\n<li>Strength of the domain (measured by links, trust, age, and possibly some usage factors)</li>\n<li>Internal and external links to the page</li>\n<li>Keyword in the title tag</li>\n</ol>\n<p>Other pages I found helpful to understand SEO:</p>\n<ul>\n<li><a href="http://www.seomoz.org/blog/if-your-page-ranks-well-youd-better-be-messing-with-it">If Your Page Ranks Well, You\'d Better Be Messing With It</a></li>\n<li><a href="http://www.stuntdubl.com/2006/10/04/website-questions/">18 Questions Your CEO Forgot to Ask When Building Your Website</a></li>\n<li><a href="http://blog.outer-court.com/archive/2007-01-07-n13.html">The Basics of Search Engine Optimization</a></li>\n<li><a href="http://www.bruceclay.com/ppc/keywordshowto.htm">How to Build a Keyword List</a></li>\n<li><a href="http://www.vaughns-1-pagers.com/internet/google-ranking-factors.htm">Google Ranking Factors - SEO Checklist</a></li>\n<li><a href="http://www.seomoz.org/article/beginners-guide-to-search-engine-optimization">Beginner\'s Guide to Search Engine Optimization</a></li>\n<li><a href="http://www.sugarrae.com/blog/before-you-launch-that-local-small-business-website/" title="Permanent Link to Before You Launch that Local Small Business Website">Before You Launch that Local Small Business Website -- SEO basics for small companies</a></li>\n</ul>\n',frontmatter:{readNext:null,title:"SEO (Search Engine Optimization) Basics",tags:["entrepreneurship","internet-marketing","SEO"],date:"April 19, 2007"}}},pathContext:{path:"/seo-search-engine-optimization-basics/",component:"/Users/kylemathews/programs/blog/pages/blog-post.js"}}}});
